				<h2>
					<a>{props.name}</a>
				</h2>
				<button> Not relevant to me</button>
			</div>
			<div className={styles.content}>
				<label>Benefit Amount</label>
				<p>{props.benifit}</p>
				<label>Grant Status</label>
				<p>{props.status}</p>
				<label>Eligibilities</label>
				<p>{props.elegibilities}</p>
			</div>
		</div>
	);
};

export default ResourceCard;
